import React, {Component} from 'react';
import { Img } from "react-image";

class Home extends Component {
  render() {
    return (
      <div className = 'All'>
        <div className = 'pphoto'>
          <Img src = 'p_photo.jpg' />
        </div> 
        <h4>Ahmed I. Khawaja</h4>
        <p>Hi, my name is <b>Ahmed</b>, and I'm a student at McMaster University studying <b>Mathematics</b> and <b>Computer Science</b></p>
      </div>
    )
  }
}

export default Home;
